function register_survey( $key, $title, $variables ) {
    $name = preg_replace('/[^A-Za-z0-9\-]/', '_', str_replace('  ', ' ',preg_replace('/[^A-Za-z0-9 \-]/','',strtolower($title))));
    return
    "array (
        'key' => $key,
        'label' => $title,
        'name' => $name,
        'type' => 'tab',
    ),
    array (
        'key' => 'field_2',
        'message' => 'Include Data From Employment & Unemployment Survey',
        'label' => 'Include Data',
        'name' => 'include_employment_unemployment',
        'type' => 'true_false',
    )";
}


 if( ! defined( 'ABSPATH' ) ) {
     die;
 }

